  \"2016-08-18T08:26:44.319917\",\n\t\"name\": \"unemployment-insurance-average-duration-beginning-2006\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains, by region and county,
  for each month from January 2006 to present, the average duration of unemployment
  insurance in New York State.rnrnAverage Duration is the average number of unemployment
  insurance weeks beneficiaries receive within their benefit year.rnrnData include
  only Regular Unemployment  Insurance (UI) excluding Unemployment Compensation for
  Federal Employees (UCFE), Unemployment Compensation for Ex-Service Members (UCX),
  Shared Work (SW), Self Employment Assistance Program (SEAP), 599.2 training, and
  federal extension programs.rnrnData are provided for the 10 labor market regions,
  and 62 counties.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
